import './App.css';
import Privacy from './Privacy';
import privacyicon from './privacy-policy.svg';

function PrivacyPage() {
  return (
    <div className="App">
      <img src={privacyicon} alt="privacy" className='App-store-button' />
      <Privacy/>
    </div>
  );
}

export default PrivacyPage;
